import {Link} from "react-router-dom"
 
  // Logo
 
 import  Logo  from './../../assets/tailwind-css-logo.svg';

const Header=({
    ...otherProps
})=>{
    return(
        <header className='bg-red-600'>
            <div>
                <img src={Logo}/>
            </div> 
 
            <nav>
                <ul>
                    <li>
                        <Link to='/'>
                            page
                        </Link>
                    </li>
                    <li>
                        <Link to='/'>
                            page
                        </Link>
                    </li>
                    <li>
                        <Link to='/'>
                            page
                        </Link>
                    </li>
                </ul>
            </nav>
        </header>

    );
};

export default Header;
